import Vue from 'vue'
import App from './App.vue'
import store from "./store/index";
import { Container, Header, Main, Footer, Aside } from 'element-ui';
// 引入VueRouter 这是一个插件，需要引入
import router from './router'
import VueRouter from 'vue-router'

Vue.config.productionTip = false
Vue.use(VueRouter)
// 引入整体布局的Element-UI
// Vue.use(Container, Header, Main, Footer, Aside)【错误写法，要一点一点地引入使用】
Vue.use(Container)
Vue.use(Header)
Vue.use(Main)
Vue.use(Footer)
Vue.use(Aside)

new Vue({
  render: h => h(App),
  store,
  router
}).$mount('#app')
